            List<Recipe> recipes = new List<Recipe>()
            {
                new Recipe{Name="Köfte",RecipeTitle="500 gr orta yağlı kıyma\r\n1 orta boy rendelenmiş soğan\r\n1 diş sarımsak\r\n1 adet yumurta\r\nYarım çay bardağı galeta unu\r\n1 yemek kaşığı sıvı yağ\r\n1 avuç ince kıyılmış maydanoz\r\n1,5 çay kaşığı tuz\r\nYarım çay kaşığı karabiber\r\n1 çay kaşığı kimyon",RecipeContext="Uygun bir yoğurma kabı içerisine kıymayı alın. Üzerine rendelenmiş soğan, sarımsak, yumurta, galeta unu, sıvı yağ, maydanoz, tuz, karabiber ve kimyonu alın ve malzemeleri yoğurun.Harcın üzerini streç ile kapatın ve 30 dakika buzdolabında dinlendirin.Sürenin sonunda harcı alın, elinizle parçalar kopartarak şekillendirin. Şekillendirilrn köfteleri uygun bir tabak içerisine alın.Köfteleri pişirmek için ocaktaki tavaya sıvı yağı ile ısıtın.Ardından köfteleri tavaya alın ve her iki tarafını da çevirerek pişirin. Afiyet olsun.",CalorieValue=235,RecipeType=RecipeType.MainCourse,DietType=DietType.Klasik,CreationDate=DateTime.Now},
                new Recipe{Name="Tavuk Sote",RecipeTitle="Yarım kg tavuk göğsü\r\n2 yemek kaşığı sıvı yağ\r\n1 tatlı kaşığı domates salçası\r\n2 adet yeşil biber\r\n1 adet kırmızı biber\r\n1 adet soğan\r\n2 diş sarımsak\r\n2 adet domates\r\nKarabiber\r\nPul biber\r\nTuz\r\n1 su bardağı su",RecipeContext="Tavuk etini kuşbaşı doğrayın.\r\nSoğanları yemeklik, biberleri julyen doğrayın, domatesleri de küp küp doğrayın.\r\nKısık ateşte tavukları arada karıştırarak kavurun.\r\nSuyunu biraz çektikten sonra soğanları ve ince kesilmiş sarımsağı ekleyin.\r\n1-2 dk kavurduktan sonra biberleri ilave edin.\r\nBiberler de sotelenince domatesi, salçayı, baharatları ve tuzu ekleyip pişirmeye devam edin.\r\nSon olarak 1 bardak suyu ekleyin ve etler pişene kadar kapağı kapalı bir şekilde pişirin.",CalorieValue=169,RecipeType=RecipeType.MainCourse,DietType=DietType.Klasik,CreationDate=DateTime.Now},
                new Recipe{Name="Karnabahar kızartması",RecipeTitle="1 adet orta boy karnabahar\r\nSu\r\nTuz\r\n2 adet yumurta\r\n1 su bardağı un\r\n1 su bardağı süt\r\n1 çay kaşığı tuz\r\nSıvı yağ",RecipeContext="Sert olan kısımları kesilmiş ve çiçekleri ayıklanmış olan karnabaharları bir tencereye koyarak üzerini geçecek şekilde su ve tuz ekleyip haşlayın. Çok fazla yumuşamasına ve dağılmasına izin verilmeden suyu süzülmelidir.\r\nBaşka bir kapta yumurta, süt çırpın. Üzerine un ve tuzu ekleyerek tekrar çırpın.\r\nHaşlanmış olan karnabaharları hazırlanan karışıma teker teker bulayarak kızgın yağda her tarafını çevirerek kızartın. Karnabaharlarınızı orta ateşte kızartmanız yeterli olacaktır.\r\nDilerseniz peçete yardımı ile fazla yağını aldıktan sonra servis tabağına alınız.\r\nÜzerinde sarımsaklı yoğurt ya da sadece yoğurt ile servis edebilirsiniz. Afiyet olsun",CalorieValue=220,RecipeType=RecipeType.MainCourse,DietType=DietType.Vegan,CreationDate=DateTime.Now},
                new Recipe{Name="Pırasa Yemeği",RecipeTitle="5-6 dal pırasa (beyaz kısımları kullanılacak)\r\n2 adet havuç\r\n1 yemek kaşığı domates salçası\r\n5-6 yemek kaşığı domates sosu\r\nYarım Türk kahvesi fincanı pirinç\r\n2 yemek kaşığı sıvı yağ\r\nTuz\r\nSıcak su",RecipeContext="Pırasa yemeği yapmak için pırasalar temizlenerek 1 cm uzunluğunda doğranır.\r\nBol su ile yıkanarak suyunun süzülmesi sağlanır.\r\n2 adet orta boy havucun dış kısmı soyulur ve ince ince halka şeklinde dilimlenir.\r\nTencereye sıvı yağ alınarak salça eklenir ve kavrulur.\r\nRendelenmiş  domates  eklenerek 1-2 tur çevirelim.\r\nDaha sonra havuç ilave edilir ve 2-3 dk hep birlikte kavrulması sağlanır.\r\nSuyu süzülen pırasalar ilave edildikten sonra karıştırılır ve tencerenin kapağı kapatılır.\r\nOrta ateşte pırasalar suyunu salıp, suyunu çekene kadar bu şekilde pişirilir.\r\nSon olarak yıkanmış pirinç ilave edilir, tuzu ayarlanır ve yemekle aynı hizaya gelecek kadar sıcak su eklenir. Su miktarı gerekirse eğer sonradan ilave ederek ayarlayabilirsiniz.\r\nTencerenin kapağı kapatılarak havuçlar ve pırasalar pişene kadar kısık ateşte pişirilir. Tüm sebzeler yumuşadıktan sonra yemeğimiz servise hazır. Afiyet olsun.",CalorieValue=185,RecipeType=RecipeType.MainCourse,DietType=DietType.Vegan,CreationDate=DateTime.Now},
                new Recipe{Name="Fırında Sütlaç",RecipeTitle="1 litre süt\r\n1 su bardağı şeker\r\nYarım su bardağı pirinç\r\n3 yemek kaşığı buğday nişastası\r\n1 paket vanilya\r\n2 su bardağı su\r\nYarım su bardağı süt ",RecipeContext="Fırında sütlaç için öncelikle pirinci haşlayalım. Pirinçleri güzelce yıkadıktan sonra 2 su bardağı su ile pişene kadar haşlayın. Çok az sulu kalacaktır.\r\nDiğer malzemeleri ekleyelim ve sütlacı pişirelim. Haşlanan pirinçlerin üzerine sütü, vanilyayı ilave edip kaynatın. Karışım kaynamaya başlayınca şekeri ve yarım su bardağı sütle karıştırdığınız 3 yemek kaşığı buğday nişastasını ilave ediniz. 10-15 dk. daha kaynatıp altını kapatın.\r\nSütlaçları fırına sürelim. Fırın için uygun ısıya dayanıklı sütlaç kaselerine sütlaçlarınızı paylaştırın. Tepsinize soğuk su doldurun ve sütlaç kaplarını fırın tepsinize dizin (Tepsideki su sütlaç kaplarının yarısına kadar gelecek)\r\nTepsiyi fırınınızın en üst rafına yerleştirin. 180 derecede, sütlaçlarınız kızarana kadar fırınlayın. Afiyet olsun.",CalorieValue=133,RecipeType=RecipeType.Dessert,DietType=DietType.Klasik,CreationDate=DateTime.Now},
                new Recipe{Name="Şekerpare",RecipeTitle="250 gram tereyağı\r\n2 çay bardağı irmik\r\n2 adet yumurta (birinin sarısı üzerine sürülecek)\r\nYarım çay kaşığı kabartma tozu\r\nYarım çay kaşığı karbonat\r\n1,5 çay bardağı pudra şekeri\r\n1 paket vanilya\r\n3,5 su bardağı un\r\n4 su bardağı toz şeker\r\n4 su bardağı su (800 ml)\r\nBirkaç damla limon suyu",RecipeContext="Şekerparenin şerbeti için bir tencereye toz şekeri alın.Üzerine suyu ilave edin.Kaynamaya başladıktan sonra ocağı orta ateşe alarak 6-7 dakika boyunca kaynatın.Hamur için oda sıcaklığında tereyağı, birinin sarısını üzeri için ayrılan yumurta,irmik,pudra şekeri,vanilya,karbonat,kabartma tozu ve unun bir kısmını ilave ederek yoğurmaya başlayın.Şekillendirmeye başlayın.Hazırladığımız şekerpareleri fırın tepsisine dizin.Ardından üzerlerine  yumurta sarısını bir fırça yardımıyla sürün.Şekerparelerimizi önceden ısıttılan 180 derece fırında 30 dakika pişirin.Fırından sıcak şekerpareleri aldıktan sonra üzerlerine soğuyan şerbeti ekleyin ve dinlenmeye bırakın.Şerbetini güzelce çeken şekerpareleri servis edebilirsiniz.Afiyet olsun!",RecipeType =RecipeType.Dessert,CalorieValue=283,DietType=DietType.Klasik,CreationDate=DateTime.Now},
                new Recipe{Name="Brownie",RecipeTitle="1 adet muz\r\n2/4 su bardağı esmer şeker\r\n2/4 su bardağı soya sütü\r\n1 su bardağı tam buğday unu\r\n1 paket Vegan bitter çikolata\r\n4 yemek kaşığı bitkisel katı yağ",RecipeContext="Öncelikle muzu bir çatal yardımı ile ezip iyice sıvı bir kıvama getiriyoruz.\r\nArdından üzerine şekerini ekleyip iyice karışana kadar çırpıyoruz.\r\nOnlar bir kenarda beklerken bir sos tavasına katı yağı koyup eritiyoruz ve üzerine çikolataları parçalayıp koyuyoruz eriyene kadar karıştırıyoruz.\r\nO eridikten sonra sütü ve çikolatayı da karışıma ekliyoruz en son unu koyup spatula yardımı ile alttan üste karıştırıyoruz.\r\nBir fırın kabını yağlayıp hafif un serptikten sonra karışımı döküyoruz.\r\nÖnceden ısıtılmış 180 derecede ki  fırında yaklaşık 20 dakika kadar pişmeye bırakıyoruz. Herkese afiyet olsun",CalorieValue=460,RecipeType=RecipeType.Dessert,DietType=DietType.Vegan,CreationDate=DateTime.Now},
                new Recipe{Name="Hurma Topları",RecipeTitle="10 adet hurma\r\n1,5 yemek kaşığı toz kakao\r\n1 yemek kaşığı toz haline getirilmiş ceviz veya fındık",RecipeContext="\"Hurmaları 10 dakika kadar sıcak suda bekletip çekirdeklerini çıkarın, kabuklarını soyun.\r\nHurmaları ceviz/fındık ve kakao ile birlikte rondodan geçirin.\r\nYanınıza bir kap su alıp ara ara ellerinizi ıslatarak toplar yapın ve dileğiniz malzeme ile kaplayın. Deneyenlere afiyet olsun.",CalorieValue=73,RecipeType=RecipeType.Dessert,DietType=DietType.Vegan,CreationDate=DateTime.Now},
                new Recipe{Name="Ayran",RecipeTitle="1 su bardağı yoğurt\r\nYarım çay bardağı süt\r\nYarım çay bardağı maden suyu\r\n1 bardak soğuk su\r\n1 çay kaşığı Tuz",RecipeContext="İlk olarak uygun bir kap içerisine yoğurdumuzu alalım. Eğer varsa ev yoğurdu yoksa hazır yoğurt kullanabilirsiniz.\r\nArdından üzerine su hariç diğer malzemelerimizi ekleyelim. Blender ile homojen bir kıvam alana kadar karıştıralım. Tuzunu kendinize göre ayarlayabilirsiniz.\r\nSuyu ekleyerek blender ile karıştırmaya devam edelim. Eğer ayranınızın daha koyu ve akışkan olmasını istiyorsanız soğuk suyu yavaş yavaş ekleyerek damak zevkinize göre ayarlayabilirsiniz.\r\nNefis bir ayran oluyor. Dilerseniz üzerine bir tutam kuru nane serpebilirsiniz ya da taze nane eşliğinde servis edebilirsiniz.\r\nBen bu ölçülerle 4  bardak ayran elde ettim. Siz oranları kişi sayınıza göre arttırarak ayarlayabilirsiniz",CalorieValue=40,RecipeType=RecipeType.Drink,DietType=DietType.Klasik,CreationDate=DateTime.Now},
                new Recipe{Name="Limonata ",RecipeTitle="1 adet limon\r\n1 adet portakal\r\n1 su bardağı toz şeker\r\n1 tatlı kaşığı limon tuzu\r\n3 litre su",RecipeContext="Limonatayı hazırlayacağınız zaman portakal ve limonu buzluktan çıkarın. \r\nRobota portakal ve limonu dilimleyin ve içine koyun.\r\n1 su bardağı şekeri üzerine ilave edin.\r\nRobotu çalıştırın ve iyice ezilene kadar çekin. \r\n3 lt suya çekilen portakal limon şeker karışımını ekleyelim.\r\n1 tatlı kaşığı limon tuzunu da ekleyip renginin iyice geçmesi için 5 dakika kadar bekleyin.\r\nBir kaba temiz bir tülbent geçirin ve içeceği süzün içinde hiç tane kalmasın. \r\nTülbentte posa kalıncaya kadar sıkın.",CalorieValue=40,RecipeType=RecipeType.Drink,DietType=DietType.Klasik, CreationDate = DateTime.Now  },
                new Recipe{Name="Limonata ",RecipeTitle="1 adet limon\r\n1 adet portakal\r\n1 su bardağı toz şeker\r\n1 tatlı kaşığı limon tuzu\r\n3 litre su",RecipeContext="Limonatayı hazırlayacağınız zaman portakal ve limonu buzluktan çıkarın. \r\nRobota portakal ve limonu dilimleyin ve içine koyun.\r\n1 su bardağı şekeri üzerine ilave edin.\r\nRobotu çalıştırın ve iyice ezilene kadar çekin. \r\n3 lt suya çekilen portakal limon şeker karışımını ekleyelim.\r\n1 tatlı kaşığı limon tuzunu da ekleyip renginin iyice geçmesi için 5 dakika kadar bekleyin.\r\nBir kaba temiz bir tülbent geçirin ve içeceği süzün içinde hiç tane kalmasın. \r\nTülbentte posa kalıncaya kadar sıkın. \r\n.",CalorieValue=40,RecipeType=RecipeType.Drink,DietType=DietType.Vegan, CreationDate = DateTime.Now},
